<html>
  <head>
        <style>
      body {
        background: linear-gradient(135deg, #a8e063, #56ab2f); /* Shades of green */
        font-family: Arial, sans-serif;
        margin: 0;
        padding: 0;
        display: flex;
        justify-content: center;
        align-items: center;
        height: 100vh;
        flex-direction: column;
      }
      .center-box {
        display: flex;
        justify-content: center;
        align-items: center;
        flex-direction: column;
      }
      .message-box {
        background: linear-gradient(45deg, #76b852, #8DC26F); /* Vibrant green gradient */
        padding: 20px;
        border-radius: 20px;
        text-align: center;
        font-size: 24px;
        color: white;
        box-shadow: 0 8px 15px rgba(0, 0, 0, 0.1);
        transition: transform 0.3s ease-in-out;
        margin-top: 20px;
      }
      .message-box:hover {
        transform: scale(1.05);
      }
      img {
        width: 300px;
        height: auto;
        margin-bottom: 20px;
      }
    </style>
  </head>
